                let psnr = 10 * Math.log10(65025 * imageWidth * imageHeight * bytesPerPixel / error);

                result.innerHTML =
                        "<span class='" + (success ? "success" : "failure") + "'>" +
                        (success ? "Success" : "Failure") + "</span><br>" +
                        "File size: " + fileSize + "<br>" +
                        "PSNR: <span class='" + (psnrGood ? "success" : "failure") + "'>" + psnr.toFixed(7) + "</span><br>" +
                        "Operation count: <span class='" + (operationCountGood ? "success" : "failure") + "'>" + operationCount + "</span>";
            };
            fr.readAsArrayBuffer(fileInput.files[0]);
        }
    </script>
</head>
<body>
<div class="container">
    <div class="center">
        <h3>Test program for <a href="https://github.com/Vort/SLIF">SLIF challenge</a>.</h3>
        <p>Select <code>image.slif</code> file and press Check button.</p>
        <input type="file" id="file-input" accept=".slif">
        <input type="button" id="check-button" value="Check" onclick="CheckClicked()">
        <p style="font-size: larger" id="result"></p>
    </div>
</div>
</body>
</html>
